import React, { useState } from 'react';

function Admin() {
  const [newMatch, setNewMatch] = useState({
    player1: '',
    player2: '',
    date: '',
    time: '',
    odds1: '',
    odds2: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewMatch(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: Implement match creation logic
    console.log('New match created:', newMatch);
    setNewMatch({
      player1: '',
      player2: '',
      date: '',
      time: '',
      odds1: '',
      odds2: ''
    });
  };

  return (
    <div className="container mt-4">
      <h2>Admin Dashboard</h2>
      <div className="row">
        <div className="col-md-6">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Create New Match</h3>
              <form onSubmit={handleSubmit}>
                <div className="mb-3">
                  <label htmlFor="player1" className="form-label">Player 1</label>
                  <input
                    type="text"
                    className="form-control"
                    id="player1"
                    name="player1"
                    value={newMatch.player1}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="player2" className="form-label">Player 2</label>
                  <input
                    type="text"
                    className="form-control"
                    id="player2"
                    name="player2"
                    value={newMatch.player2}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="date" className="form-label">Date</label>
                  <input
                    type="date"
                    className="form-control"
                    id="date"
                    name="date"
                    value={newMatch.date}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="time" className="form-label">Time</label>
                  <input
                    type="time"
                    className="form-control"
                    id="time"
                    name="time"
                    value={newMatch.time}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="odds1" className="form-label">Player 1 Odds</label>
                  <input
                    type="number"
                    className="form-control"
                    id="odds1"
                    name="odds1"
                    value={newMatch.odds1}
                    onChange={handleChange}
                    step="0.1"
                    min="1"
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="odds2" className="form-label">Player 2 Odds</label>
                  <input
                    type="number"
                    className="form-control"
                    id="odds2"
                    name="odds2"
                    value={newMatch.odds2}
                    onChange={handleChange}
                    step="0.1"
                    min="1"
                    required
                  />
                </div>
                <button type="submit" className="btn btn-primary">Create Match</button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Admin;
